import Web3 from 'web3'
import BigNumber from "bignumber.js";
import { Typography, Button, TextField, Grid, CircularProgress, Alert } from '@mui/material'
//token logo
import tokenlogo from "./img/favicon.png"
import lock from "./img/lock.png"
import HeaderA from "./Header"



const Mainapps = ()=>{


// start
//loadweb3.js
const loadWeb3 = async () => {
  if (window.ethereum) {
    await window.ethereum.enable()
  } else {
    window.alert(
      "Non-Ethereum browser detected. You should consider trying MetaMask!"
    );
  }
  if (
    typeof window.ethereum == "undefined" 
  ) {
    return;
  }
}



// end
return (<>
<HeaderA loadWeb3={loadWeb3}/>
<div className="mainapp">

<div className="staking_main">
<div className="mystake">
<h2>My Staking</h2>
<h2 className="APY">100% <span className="small">APR</span></h2>
</div>

<div className="totaltoken">

<div className="totalZStaked">
<h3>TOTAL STAKED</h3>
<p>1000 <span className="small">TRDC</span></p>

</div>
<div className="Howmuchuhave">
<h3>AVAILABLE
</h3>
<p>100 <span className="small">TRDC</span></p>

</div>
</div>
<div className="input_pair">
<input type="text" value="0"></input>
<div className="pair"><img className="token_logo" src={tokenlogo}></img>
<h3>TRDC</h3>
</div>
</div>
<div className="cliam">
<div className="Reward_token">
  <h3>CLIAMABLE REWARDS
</h3>
<p>100 TRDC</p>
</div>
<button className="Get">Claim</button>
</div>
<div className="stake">
{/* <button>Stake</button> */}
<a href="javascript:void(0)" className="test_">
  <span>Stake</span>
  <div class="wave"></div>
</a>

</div>
<div className="Unstake">

<button>UnStake</button>

</div>


</div>








</div>








</>


